// src/App.js
import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Alerts from './components/Alerts';
import MissionControl from './components/MissionControl';
import ObjectRecognition from './components/ObjectRecognition';
import PayloadManagement from './components/PayloadManagement';
import Settings from './components/Settings';
import TrainingSimulation from './components/TrainingSimulation';

import Dashboard from './Dashboard'; // Import your dashboard component


function App() {
  return (
    <BrowserRouter>
      <div className="app-container">
        <Routes>
          <Route path="/" element={<Dashboard />} /> 
          <Route path="/missioncontrol" element={<MissionControl/>} />
          <Route path="/alerts" element={<Alerts/>} />
          <Route path="/objectrecognition" element={<ObjectRecognition/>} />
          <Route path="/payloadmanagement" element={<PayloadManagement/>} />
          <Route path="/settings" element={<Settings/>} />
          <Route path="/trainingsimulation" element={<TrainingSimulation/>} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
